# Validator Classes
class Validator:
    def update_error_messages(self, error_dict: Dict[str, str]) -> Dict[str, str]:
        """Update error messages for clarity."""
        updated_errors = {k: f"ERROR: {v}" for k, v in error_dict.items()}
        logging.info("Updated error messages")
        return updated_errors

    def prevent_duplicate_transactions(self, transaction_ids: List[str]) -> bool:
        """Prevent duplicate transactions from being published."""
        unique_ids = list(set(transaction_ids))
        logging.info(f"Filtered duplicates, remaining: {unique_ids}")
        return len(unique_ids) == len(transaction_ids)

